import React from "react";

class Userclass extends React.Component{
    constructor(props){
        super(props);
        this.state={
            userinfo :{
                name:"dummy",
                location:"Default"
            },
        }
    }
    async componentDidMount(){
        const data =await fetch("https://api.github.com/users/Subham-kumar-Tripathy")
        const json=await data.json();

        this.setState({
            userinfo:json,
        });

        console.log(json);
    }
        
    render(){
        const{name,location}=this.state.userinfo;
        return(
            <div>
                <h1>Education:Master of Computer aplication</h1>
                <h3>ame :{name}</h3>
                <h3>Loaction :{location}</h3>
            </div>
        );
    }
}
export default Userclass
